import { useRouter } from "next/router";
const One = () => {
  const router = useRouter();
  const [state, setState] = useState({
    res: []
  });
  useEffect(() => {
    fetchData();
  }, []);
  const fetchData = async () => {
    try {
      const data = await Axios("https://jsonplaceholder.typicode.com/users");
      setState({
        ...state,
        res: data.data
      });
    } catch (error) {
      alert(error);
    }
  };
  return (
    <div>
      <h1>{router.query.id}</h1>
    </div>
  );
};

export default One;
